        <div>
        <div className="story">
          <div className="marginbottom">(모든 결말 다음에 추가해주세요)
미궁 스토리에 도움을 주신 모든 분께 감사합니다.
 
made by 사이버포스텍카이스트학생교류전 준비위원회 홍보팀
김동하
김민규
